import React, { useState } from "react";

function Main() {
  const [data, setData] = useState({});

  React.useEffect(() => {
    fetch("https://kevinkkimutai.github.io/charity/db.json")
      .then((response) => response.json())
      .then((data) => setData(data));
  }, []);
  console.log(data);
  return (
    <div>
      <div className="sidenav" data-bs-theme="dark">
        {data.place &&
          data.place.map((place) => (
            <div key={place.ein}>
              {/* <h2>{place.contactName}</h2> */}

              <a href="/">{place.charityName}</a>
              {/* <p>{place.activities}</p>
       <p>Funding: {place.funding}</p>
       <p>Goal: {place.goal}</p> */}
            </div>
          ))}
      </div>

      <div className="main">
        {data.place &&
          data.place.map((place) => (
            <div key={place.ein}>
              <h2>{place.charityName}</h2>
              <p>{place.activities}</p>
              <p>Funding: {place.funding}</p>
              <p>Goal: {place.goal}</p>
              <p>{place.address}</p>
              <p>{place.phone}</p>
              <p>{place.email}</p>
              "state" "zipCode"
            </div>
          ))}
      </div>
    </div>
  );
}

export default Main;
